import React from 'react'
import styled from "styled-components";

const TodoList = ({data}) => {

    return (
        <div>
            <StyledUl>
                {data.map(({label, id}) => {
                    return (
                            <StyledLi key = {id}>
                                {label}
                            </StyledLi>
                        )
                })}

            </StyledUl>
        </div>
    )
};

export default TodoList;
